import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPlug, faCar } from "@fortawesome/free-solid-svg-icons";

const StationAndVehicleData = ({
	station_id,
	max_feasible_rate,
	charge_rate,
	charger_priority,
	vehicle_soc,
	vehicle_max_charging_rate,
	vehicle_scheduled_time,
	vehicle_desired_soc,
	estimated_charging_time,
}) => {
	return (
		<div className="m-5 p-10 bg-slate-200 rounded-lg w-3/4">
			<div className="bg-slate-200 p-4 rounded-lg shadow-md w-1/4">
				<div className="flex items-center justify-center shadow-sm rounded-full bg-slate-100 w-24 h-32">
					<FontAwesomeIcon
						icon={faPlug}
						className="text-blue-500 text-3xl mr-2"
					/>
				</div>
				<p>Charge Rate: {max_feasible_rate}</p>
				<p>Max Charge Rate: {charge_rate}</p>
				<p>Charger Priority: {charger_priority}</p>
				<div className="flex items-center mt-4">
					<FontAwesomeIcon
						icon={faCar}
						className="text-green-500 text-xl mr-2"
					/>
					<h3 className="text-md font-bold">Vehicle Data</h3>
				</div>
				<p>SOC: {vehicle_soc}</p>
				<p>Max Charge Rate: {vehicle_max_charging_rate}</p>
				<p>Departure Time: {vehicle_scheduled_time}</p>
				<p>Desired SOC: {vehicle_desired_soc}</p>
				<p>Estimated Charging Time: {estimated_charging_time}</p>
			</div>
		</div>
	);
};

export default StationAndVehicleData;
